import React, {Component} from 'react';

class Note extends Component {

    render() {
        return (
            <div>
                <input type="checkbox" onChange={this.props.handleCheck}
                       defaultChecked={this.props.checked}/>
                <h4>{this.props.text}</h4>
            </div>
        )
    }
}

export default Note;
